def get_cols(names):
  l = []
  for name in names:
  if name in COL_MAP:
  l += COL_MAP[name]
  else:
  l += [name]
  return l

def week_number_to_date(week_number, first_week_date='20220101'):
  '''
  Prepare a date column for ARIMA
  '''
  return pd.to_datetime(first_week_date, format='%Y%m%d') + pd.DateOffset(days=7*(week_number - 1))

