  cutoff = int(cutoff_rate * len(df_input))
  if cutoff_rate < 1:
  valid = df_input[cutoff:]
  train = df_input[:cutoff]
  model = auto_arima(train, trace=False, error_action='ignore', suppress_warnings=True)
  model.fit(train)
  forecast = model.predict(n_period)
  return(forecast)

